pragma solidity ^0.4.18;


import "./WolsukiBase.sol";
import "oraclize-api/usingOraclize.sol";


/// @title Valet contract for Wolsuki. Holds all functions and variables related to
/// end a pool or house cleaning.
/// @author Wolsuki (https://www.wolsuki.com)
contract WolsukiValet is WolsukiBase, usingOraclize {

    /// @dev The FixtureEnded event is emitted whenever a fixture is ended.
    event FixtureEnded(uint256 _fixtureId);


    /// @dev this maps the oraclize query id to a fixture id. Only callback that matches
    /// with a valid fixture id can be called.
    mapping(bytes32 => uint256) private fixtureQueries;


    /// @dev constructor function for WolsukiValet. Here we need to set authenticity proof
    /// for random source from oraclize
    function WolsukiValet() public {
        // sets the Ledger authenticity proof in the constructor
        oraclize_setProof(proofType_Ledger);
    }

    function endFixture(uint16 _fixtureId)
        public
        payable
        onlyOwner
    {
        Fixture storage fixture = fixtures[_fixtureId];
        // the fixture must still be opened
        require(!fixture.ended && now > fixture.endedAt);

        // this function internally generates the
        bytes32 queryId = oraclize_query('URL', 'html(http://www.fifa.com/worldcup/matches/round=255931/match=300186456/index.html).xpath(//*[contains(@class, "s-scoreText")]/text())');

        // maps this query to the ending pool
        fixtureQueries[queryId] = _fixtureId;
    }

    /// @dev the callback function is called by Oraclize when the result is ready.
    /// The fixture must still be opened for the pool to be properly ended.
    /// Fixture's status will the set with the result from oraclize.
    function __callback(bytes32 _queryId, string _result, bytes _proof)
        public
    {
        require(msg.sender == oraclize_cbAddress());

        uint256 fixtureId = fixtureQueries[_queryId];
        Fixture storage fixture = fixtures[fixtureId];
        // the fixture must still be opened.
        require(!fixture.ended);

        fixture.ended = true;
        fixture.status = status(_result);
        delete fixtureQueries[_queryId];

        FixtureEnded(fixtureId);
    }

    function status(string score)
        internal
        pure
        returns (uint8)
    {
        bytes memory scoreBytes = bytes(score);
        bytes1[] memory homeBytes = new bytes1[](2);
        bytes1[] memory awayBytes = new bytes1[](2);
        uint8 homeCount = 0;
        uint8 awayCount = 0;
        uint8 count = 0;
        bytes1 currentByte = scoreBytes[count];

        while (currentByte != '-') {
            homeBytes[homeCount] = (currentByte);
            homeCount++;
            count++;
            currentByte = scoreBytes[count];
        }

        count++;
        while(count < scoreBytes.length) {
            currentByte = scoreBytes[count];
            awayBytes[awayCount] = currentByte;
            awayCount++;
            count++;
        }

        if (homeBytes[1] > awayBytes[1])
            return 1;
        else if (homeBytes[1] < awayBytes[1])
            return 2;
        else if (homeBytes[0] > awayBytes[0])
            return 1;
        else if (homeBytes[0] < awayBytes[0])
            return 2;

        return 3;
    }
}

